hambuni vees.\"</font></a>\n</td><td align=\"right\" nowrap>\n&nbsp;&nbsp;<font color=\"#999999\">17.12.2008 12:28</font>\n</td>\n</tr>\n<tr><td></td>\n<td width=\"100%\" valign=\"top\" colspan=\"2\">\nja midagi ka hingele: <a href=\"http://ngm.nationalgeographic.com/photo-contest/2008-winners?startgallery=1\" target=\"_blank\"><b>win</b>ners?startgallery=1<font color=\"#3399FF\">http://ngm.nationalgeographic.com/photo-contest/200<b>8</b>-</font></a><br /></td>\n</tr><tr>\n<td align=\"right\" valign=\"top\">\n<font color=\"#999999\">66</font>\n</td><td valign=\"top\">\n<a href=\"message:143803\"><font color=\"#3399FF\">Andr\u00e9 Karpi\u0161t\u0161enko in Group chat \"PC | Lemberakud hambuni vees.\"</font></a>\n</td><td align=\"right\" nowrap>\n&nbsp;&nbsp;<font color=\"#999999\">31.10.2008 13:41</font>\n</td>\n</tr>\n<tr><td></td>\n<td width=\"100%\" valign=\"top\" colspan=\"2\">\nSuppose that every day, ten men go out for beer and the bill for all ten<br />comes to $100.<br />If they paid their bill the way we pay our taxes, it would go something<br />like this:<br /><br />The first four men (the poorest) would pay nothing.<br /><br />The fifth would pay $1.<br />The sixth would pay $3.<br />The seventh would pay $7.<br />The eighth would pay $12.<br />The ninth would pay $1<b>8</b>.<br /><br />The tenth man (the richest) would pay $59.<br /><br />So, that's what they decided to do.<br />The ten men drank in the bar every day and seemed quite happy with the<br />arrangement, until one day, the owner threw them a curve.<br /><br />'Since you are all such good customers,' he said, 'I'm going to reduce the<br />cost of your daily beer by $20.' Drinks for the ten now cost just $<b>8</b>0.<br /><br />The group still wanted to pay their bill the way we pay our taxes. So the<br />first four men were unaffected. They would still drink for free. But what<br />about the other six men? The paying customers?<br /><br />How could they divide the $20 <b>win</b>dfall so that everyone would get his<br />'fair share?'<br />They realized that $20 divided by six is $3.33. But if they subtracted<br />that from everybody's share, then the fifth man and the sixth man would<br />each end up being paid to drink his beer.<br /><br />So, the bar owner suggested that it would be fair to reduce each man's<br />bill by roughly the same amount, and he proceeded to work out the amounts<br />each should pay.<br /><br />And so the fifth man, like the first four, now paid nothing (100% savings)<br />The sixth now paid $2 instead of $3 (33% savings).<br />The seventh now pay $5 instead of $7 (2<b>8</b>% savings).<br />The eighth now paid $9 instead of $12 (25% savings).<br />The ninth now paid $14 instead of $1<b>8</b> ( 22% savings).<br />The tenth now paid $49 instead of $59 (16% savings).<br /><br />Each of the six was better off than before. And the first four continued<br />to drink for free. But once outside the restaurant, the men began to<br />compare their savings.<br /><br />'I only got a dollar out of the $ 20,'declared the sixth man. He pointed<br />to the tenth man,' but he got $10!'<br /><br />'Yeah, that's right,' exclaimed the fifth man. 'I only saved a Dollar,<br />too. It's unfair that he got ten times more than I!'<br /><br />'That's true!!' shouted the seventh man. 'Why should he get $10 back when<br />I got only two? The wealthy get all the breaks!'<br /><br />'Wait a minute,' yelled the first four men in unison. 'We didn't get<br />anything at all. The system exploits the poor!'<br /><br />The nine men surrounded the tenth and beat him up.<br /><br />The next night the tenth man didn't show up for drinks, so the nine sat<br />down and had beers without him. But when it came time to pay the bill,<br />they discovered something important. They didn't have enough money between<br />all of them for even half of the bill!<br /><br />And that, boys and girls, journalists and college professors, this is how<br />our tax system works.<br />The people who pay the highest taxes get the most benefit from a tax<br />reduction.<br />Tax them too much, attack them for being wealthy, and they just may not<br />show up anymore.<br />In fact, they might start drinking overseas where the atmosphere is<br />somewhat friendlier.<br /><br />David R. Kamerschen, Ph.D.<br />Professor of Economics<br />University of Georgia<br /></td>\n</tr><tr>\n<td align=\"right\" valign=\"top\">\n<font color=\"#999999\">67</font>\n</td><td valign=\"top\">\n<a href=\"message:142827\"><font color=\"#3399FF\">Andr\u00e9 Karpi\u0161t\u0161enko in Group chat \"PC | Lemberakud hambuni vees.\"</font></a>\n</td><td align=\"right\" nowrap>\n&nbsp;&nbsp;<font color=\"#999999\">02.10.2008 18:10</font>\n</td>\n</tr>\n<tr><td></td>\n<td width=\"100%\" valign=\"top\" colspan=\"2\">\nigatahes erki, proovi t\u00f5mmata 4.0 beta ja siis View-&gt;Compact view<br /><a href=\"http://www.skype.com/intl/en/download/skype/windows/beta/\" target=\"_blank\"><font color=\"#3399FF\">http://www.skype.com/intl/en/download/skype/<b>win</b>dows/beta/</font></a><br /><br />ning kui ei meeldi, siis \u00f5pi flamemise kunsti siit:<br /><a href=\"http://community.zdnet.co.uk/blog/0,1000000567,10009437o-2000498448b,00.htm\" target=\"_blank\"><b>8</b>b,00.htm<font color=\"#3399FF\">http://community.zdnet.co.uk/blog/0,1000000567,10009437o-200049<b>8</b>44</font></a><br />ja siit:<br /><a href=\"http://community.zdnet.co.uk/blog/0,1000000567,10008882o-2000498448b,00.htm#comments\" target=\"_blank\"><b>8</b><b>8</b>44<font color=\"#3399FF\">http://community.zdnet.co.uk/blog/0,1000000567,1000<b>8</b><b>8</b>2o-200049<b>8</b>b,00.htm#comments</font></a><br /><br />ning siis veel \u00fcks link:<br /><a href=\"http://www.porno.ee\" target=\"_blank\"><font color=\"#3399FF\">www.porno.ee</font></a><br /></td>\n</tr><tr>\n<td align=\"right\" valign=\"top\">\n<font color=\"#999999\">68</font>\n</td><td valign=\"top\">\n<a href=\"message:139162\"><font color=\"#3399FF\">Andr\u00e9 Ka